import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
from sklearn.decomposition import PCA
from sklearn.preprocessing import StandardScaler
from sklearn.datasets import make_classification
from sklearn.model_selection import train_test_split

# gerarando dados de exemplo
X, y = make_classification(n_samples=1000, n_classes=2, random_state=42)
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=42)


# padronizando os dados
x = StandardScaler().fit_transform(X)

# aplicando o PCA
pca = PCA(n_components=2)
principalComponents = pca.fit_transform(x)

# criando um DataFrame com os componentes principais e as classes
principalDf = pd.DataFrame(data = principalComponents
             , columns = ['principal component 1', 'principal component 2'])
finalDf = pd.concat([principalDf, pd.DataFrame(y, columns = ['target'])], axis = 1)

# plota o gráfico PCA
fig = plt.figure(figsize = (8,8))
ax = fig.add_subplot(1,1,1)
ax.set_xlabel('Principal Component 1', fontsize = 15)
ax.set_ylabel('Principal Component 2', fontsize = 15)
ax.set_title('2 component PCA', fontsize = 20)
targets = [0, 1]
colors = ['r', 'g']
for target, color in zip(targets,colors):
    indicesToKeep = finalDf['target'] == target
    ax.scatter(finalDf.loc[indicesToKeep, 'principal component 1']
               , finalDf.loc[indicesToKeep, 'principal component 2']
               , c = color
               , s = 50)
ax.legend(targets)
ax.grid()
plt.show()

import pandas as pd
import numpy as np
from sklearn.model_selection import train_test_split
from sklearn.neighbors import KNeighborsClassifier
from sklearn.metrics import classification_report, confusion_matrix, accuracy_score
import seaborn as sns
import matplotlib.pyplot as plt

# 1. Carregar o dataset
url = "https://archive.ics.uci.edu/ml/machine-learning-databases/breast-cancer-wisconsin/breast-cancer-wisconsin.data"
columns = ['ID', 'Clump Thickness', 'Uniformity of Cell Size', 'Uniformity of Cell Shape',
           'Marginal Adhesion', 'Single Epithelial Cell Size', 'Bare Nuclei',
           'Bland Chromatin', 'Normal Nucleoli', 'Mitoses', 'Class']
for col in df.select_dtypes(include=['object']).columns:
    # tenta converter para float, substituindo valores inválidos por NaN
    df[col] = pd.to_numeric(df[col], errors='coerce')

# verificar novamente os tipos de dados após a conversão
print(df.dtypes)

df = pd.read_csv(url, header=None, names=columns)
df = df.replace('?', np.nan)
df = df.dropna()
df.iloc[:, 1:] = df.iloc[:, 1:].astype(float)
X = df.iloc[:, 1:-1]  # exclui 'ID' e 'Class', são descartados pois não são atributos relevantes no treinamento
y = df['Class'].map({2: 0, 4: 1})  # 2 = Benigno, 4 = Maligno
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=42, stratify=y) ##############treinamento
k = 3  # número de vizinhos
knn = KNeighborsClassifier(n_neighbors=k) # treinamento
knn.fit(X_train, y_train)
y_pred = knn.predict(X_test)
print("\nMatriz de Confusão:")
cm = confusion_matrix(y_test, y_pred)
sns.heatmap(cm, annot=True, fmt='d', cmap='Blues', xticklabels=['Benigno', 'Maligno'], yticklabels=['Benigno', 'Maligno'])
plt.title("Matriz de Confusão")
plt.xlabel("Predição")
plt.ylabel("Verdadeiro")
plt.show()
print("\nRelatório de Classificação:")
print(classification_report(y_test, y_pred))

print(f"Acurácia: {accuracy_score(y_test, y_pred):.2f}")

# 5. visualização dos atributos
sns.boxplot(data=X_train)
plt.title("Distribuição dos Atributos de Treinamento")
plt.xticks(rotation=45)
plt.show()

