import numpy as np
import matplotlib.pyplot as plt
from sklearn.datasets import make_classification
from sklearn.model_selection import train_test_split
from sklearn.linear_model import LogisticRegression
from sklearn.metrics import roc_curve, roc_auc_score

# gerando dados de exemplo
X, y = make_classification(n_samples=1000, n_classes=2, random_state=42) # cria dados aleatórios para classificação com 1000 amostras e 2 classes
#1000 amostras é um valor padrão para um treinamento mais rápido
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=42) #30 porcento de teste e 70 de treinamento

# treinando um modelo de regressão logística
model = LogisticRegression()
model.fit(X_train, y_train)
# o modelo de regressão logística foi usado pois é recomendado para resolver problemas de classificação binária
#onde a variável tem dois possiveis valores

# obtendo as pontuações de previsão (probabilidades)
y_scores = model.predict_proba(X_test)[:, 1]

# calculando a curva ROC
fpr, tpr, thresholds = roc_curve(y_test, y_scores)
roc_auc = roc_auc_score(y_test, y_scores)

# plotando a curva ROC
plt.figure()
plt.plot(fpr, tpr, color='blue', lw=2, label='Curva ROC (área = %0.2f)' % roc_auc)
plt.plot([0, 1], [0, 1], color='gray', lw=2, linestyle='--')
plt.xlim([0.0, 1.0])
plt.ylim([0.0, 1.0])
plt.xlabel('Taxa de Falsos Positivos')
plt.ylabel('Taxa de Verdadeiros Positivos')
plt.title('Curva ROC')
plt.legend(loc="lower right")
plt.show()

"""Linha pontilhada (linha de referência): Representa um modelo aleatório (50% de acerto), que serve como base para comparação. Um modelo melhor do que o aleatório deve ter uma curva acima dessa linha.

Área sob a curva (AUC - 0.91): O valor 0.91 indica uma boa capacidade de discriminação do modelo, ou seja, ele consegue separar corretamente as classes positiva e negativa na maioria das vezes. O AUC varia de 0 a 1:

1.0: Desempenho perfeito.
0.5: Desempenho equivalente ao aleatório.
"""